taskSetItem.script2:
//接收
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();
var taskId = eio.readString8();  //订单ID
var e0 = eio.readString32();   //查询
var e1 = eio.readInt32();      //订单完成
var e2 = eio.readInt32();      //订单取消1
var e3 = eio.readInt32();      //订单取消2
var e4 = eio.readInt32();      // 开单
var e5 = eio.readInt32();      //接单
//es.logWarning(e1);
//es.logWarning(e2);
//es.logWarning(e3);
//产生条件语句 where accountName='" + db.encode(session.get("username")) + "'
var condition = "where 1=1 ";

if(e1!=1 & e2!=1 & e3!=1 & e4!=1 & e5!=1){
    condition +="and (logType = '订单完成' or logType = '订单取消'or logType= '订单取消1'or logType= '订单取消2'or logType='开单'or logType='接单'or logType='开始陪练')";
} 
if(taskId!=""){
    condition +=" and log.intParam1 = " +taskId;
}
if(e0!=""){
    condition +=" and concat([userInfo].nickName,[userInfo].mobile,[userInfo].idName,[log].logType,[log].strParam1,[log].strParam2,[log].strParam3,[log].note) like '%" + db.encode(e0) + "%'";
}

if (e1!=0) {
    condition += " and logType = '订单完成'";
}
if (e2!=0) {
    condition += " and logType = '订单取消1'";
}
if (e3!=0) {
    condition += " and logType = '订单取消2'";
}
if (e4!=0) {
    condition += " and logType = '开单'";
}
if (e5!=0) {
    condition += " and logType = '接单'";
}

var sql, sqlResult;
//获取记录数量
sql = "select count(*) as c from log LEFT OUTER JOIN [userInfo] ON userInfo.id = [log].userId  "+
       "LEFT OUTER JOIN userInfo as c ON c.id = log.intParam2 " +
       condition; 
es.logWarning(sql);
sqlResult = db.executeQuery("PJ", sql);
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql = "select [log].id,[log].regDatetime,[log].userId,[log].logType,[log].dtParam1,[log].dtParam2,[log].intParam1,[log].intParam3," +
      "ISNULL(cast([log].intParam4 as nvarchar),'0') as intParam4,[log].intParam5,[log].strParam1,[log].strParam2,[log].strParam3 ," +
      "[userInfo].nickName,[userInfo].mobile,[userInfo].idNumber,[userInfo].idName ,c.mobile  as mb,c.idName as cidName," +
      "ISNULL(cast([log].intParam2 as nvarchar),'0') +'`'+ ISNULL(cast(c.nickName as nvarchar),'') +'`'+ ISNULL(c.mobile,'') + '`'+ ISNULL(c.idName,'') +'`'+ ISNULL([log].note,'') as data " +
      "from [log] LEFT OUTER JOIN [userInfo] ON userInfo.id = [log].userId " +
      "LEFT OUTER JOIN [userInfo] as c ON c.id = [log].intParam2　" +
      condition +"order by id desc";

es.logWarning(sql);    
var sqlResult = db.executeQuery("PJ", sql);
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,regDatetime,userId,nickName,mobile,idName,logType,dtParam1,dtParam2,intParam1,data,mb,cidName,intParam3,intParam4,intParam5,strParam1,strParam2,strParam3", pageSize*(pageCurrent-1), pageSize);

es.logWarning("success");

taskSetItem.script3:
